import React, { useEffect } from 'react';
import { Layout, Row, Col } from 'antd';
import Navbar from '../../components/Navbar'
import styled from 'styled-components'
import FirstSection from './FirstSection'
import Particles from 'react-particles-js'

const BackgroundPolygons = styled(Particles)`
    padding-top: 90px;
    margin-top: -90px;
    background-color: #FFCB05;
`

const LayoutStyled = styled(Layout)`
    background: rgba(0,0,0,0);
`

const MainPage: React.FC = () => {
    return (
        <LayoutStyled>
            <Navbar/>
            <BackgroundPolygons params={{
                    "particles": {
                        "number": {
                            "value": 160,
                            "density": {
                                "enable": false
                            }
                        },
                        "size": {
                            "value": 3,
                            "random": true,
                            "anim": {
                                "speed": 4,
                                "size_min": 0.3
                            }
                        },
                        "line_linked": {
                            "enable": false
                        },
                        "move": {
                            "random": true,
                            "speed": 1,
                            "direction": "top",
                            "out_mode": "out"
                        }
                    },
                    "interactivity": {
                        "events": {
                            "onhover": {
                                "enable": true,
                                "mode": "bubble"
                            },
                            "onclick": {
                                "enable": true,
                                "mode": "repulse"
                            }
                        },
                        "modes": {
                            "bubble": {
                                "distance": 250,
                                "duration": 2,
                                "size": 0,
                                "opacity": 0
                            },
                            "repulse": {
                                "distance": 400,
                                "duration": 4
                            }
                        }
                    }
                }}>
                <Col span={4}/>
                <Col span={16}>
                    <FirstSection/>
                </Col>
                <Col span={4}/>
            </BackgroundPolygons>
        </LayoutStyled>
    )
};

export default MainPage
